import { useEffect, useState } from 'react';

function App() {

  useEffect(() => {
    // fetch returns a promise
    fetch('https://dummyjson.com/todos/user/5')
    .then((res) => res.json())
    .then((data) => console.log('data', data))
    // data mutation
  }, [])

  return (
    <section>
      <header>
        <h1>Todos</h1>
      </header>
    </section>
  );
}

export default App;
